import { Component, OnInit } from '@angular/core';
import { Observable } from 'rxjs';
import { CarService } from '../../services/car.service';
import { ICar } from '../../models/car';
import { Router } from '@angular/router';
import { FormControl } from '@angular/forms';

@Component({
  selector: 'app-index-cars',
  templateUrl: './index-cars.component.html',
  styleUrls: ['./index-cars.component.css']
})
export class IndexCarsComponent implements OnInit {

  cars!: ICar[];
//adaugare


  brand2:string='';
  model2:string='';
  productionYear2=0;
  stock2=0;


  constructor(private carService:CarService, private router: Router) {}

  ngOnInit(): void {
    this.carService.getCars().subscribe(res => {
      this.cars =res;
    console.log(res); }
    )
   }

   showCar(car: ICar)
   {
    this.router.navigate([`/cars/${car.idCar}`]);
   }


   createCar() {

   /* const car: ICar={
    brand: 'VW',
    model: '343',
    productionYear:2022,
    stock: 3
    };*/




    let car:ICar={

      brand:this.brand2,
    model:this.model2,
    productionYear: this.productionYear2,
    stock:this.stock2

    };





  // this will be replaced with form value
  this.carService.createCar(car).subscribe(
    res => this.cars.push(res), 
  );
}



  deleteCar(car: ICar)
  {
    this.carService.deleteCar(car.idCar).subscribe(
      (res: any)=> {
        const carIndex = this.cars.indexOf(car);
        this.cars.splice(carIndex,1);
      }
    )
  }


  updateCar(car:ICar)
  {
    let carr:ICar = {
      brand:this.brand2,
    model:this.model2,
    productionYear: this.productionYear2,
    stock:this.stock2
    }

    this.carService.updateCar(car).subscribe(
      res=>{
        const carIndex = this.cars.indexOf(car);
        this.cars.splice(carIndex,1,carr); // sterge elementul de la indexul carIndex si il inlocuieste cu carr

  });
    }

}
