<style>
.center {
    display: flex;
    justify-content: center;
    align-items: center;
    height: 20px;

  }
</style>





<h3> Car Form</h3>
<form #carForm="ngForm" ngFor="let car " (ngSubmit)="createCar(); updateCar(car)"; >



    <div class="form-group">
      <label for="brand">Brand</label>
      <input type="text" class="form-control" id="brand"
             [(ngModel)]="brand2" name="brand">
    </div>

    <div class="form-group">
      <label for="model">Model</label>
      <input type="text" class="form-control" id="model"
             [(ngModel)]="model2" name="model">

    </div>


    <div class="form-group">
        <label for="productionYear">Production Year</label>
        <input type="text" class="form-control" id="productionYear"
               [(ngModel)]="productionYear2" name="productionYear">

      </div>

      <div class="form-group">
        <label for="stock">Stock</label>
        <input type="text" class="form-control" id="stock"
               [(ngModel)]="stock2" name="stock">

      </div>  


      <button type="submit" class="btn btn-primary me-2">Create Car</button>

    <button  type="submit" class="btn btn-danger me-2">Update</button>

</form>

<!--<button (click)="createCar()" type="button" class="btn btn-primary me-2">Create Car</button>-->


<div *ngFor="let car of cars">{{car.idCar}} - {{car.brand}} - {{car.model}} - {{car.productionYear}} - {{car.stock}}

    <div class="center">

    <button (click)="showCar(car)" type="button" class="btn btn-primary me-2">Show Car</button> 

    <button (click)="deleteCar(car)" type="button" class="btn btn-danger me-2">Delete</button>

    <!--<button (click)="updateCar(car)" type="button" class="btn btn-danger me-2">Update</button>-->
    </div>


</div>
